import React from 'react';
import ReactDom from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter , Routes , Route } from 'react-router-dom';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <React.StrictMode>
    <BrowserRouter>
    <Routes> 
      <Route> 
    <App />
    </Route>
    </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

